  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Chronic Conditions among Medicare Beneficiaries
  is a chartbook prepared by the Centers for Medicare and Medicaid Services and created
  to provide an overview of chronic conditions among Medicare beneficiaries.  The
  chartbook highlights the prevalence of chronic conditions among Medicare beneficiaries
  and the impact of chronic conditions on Medicare service utilization and spending.
  \ The Portable Document File format allows for online viewing and printing of the
  entire chartbook, the data tables provide spreadsheets with the underlying data,
  and the presentation includes all the chartbook figures for print or download.</p>n\",\n\t\"license_title\":
